#
# TABLE STRUCTURE FOR: Computer
#

DROP TABLE IF EXISTS `Computer`;

CREATE TABLE `Computer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Operating_system` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Frequency` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Monitor` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Video_card` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `HDD` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Mouse` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Keyboard` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Headphones` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Consoles
#

DROP TABLE IF EXISTS `Consoles`;

CREATE TABLE `Consoles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Type` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Generation` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Employees
#

DROP TABLE IF EXISTS `Employees`;

CREATE TABLE `Employees` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Full_name` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Address` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Income` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Positions_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_Employees_Positions1_idx` (`Positions_id`),
  CONSTRAINT `fk_Employees_Positions1` FOREIGN KEY (`Positions_id`) REFERENCES `Positions` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Platform
#

DROP TABLE IF EXISTS `Platform`;

CREATE TABLE `Platform` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Computer_id` int(11) NOT NULL,
  `Consoles_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_Platform_Computer1_idx` (`Computer_id`),
  KEY `fk_Platform_Consoles1_idx` (`Consoles_id`),
  CONSTRAINT `fk_Platform_Computer1` FOREIGN KEY (`Computer_id`) REFERENCES `Computer` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Platform_Consoles1` FOREIGN KEY (`Consoles_id`) REFERENCES `Consoles` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Player_Information
#

DROP TABLE IF EXISTS `Player_Information`;

CREATE TABLE `Player_Information` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Full_name` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Mail` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Positions
#

DROP TABLE IF EXISTS `Positions`;

CREATE TABLE `Positions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Title` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Salary` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Access _levels` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Services
#

DROP TABLE IF EXISTS `Services`;

CREATE TABLE `Services` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Title` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Tariff` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Food` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Storage_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_Services_Storage1_idx` (`Storage_id`),
  CONSTRAINT `fk_Services_Storage1` FOREIGN KEY (`Storage_id`) REFERENCES `Storage` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Storage
#

DROP TABLE IF EXISTS `Storage`;

CREATE TABLE `Storage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Title` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Quantity` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Vacancies
#

DROP TABLE IF EXISTS `Vacancies`;

CREATE TABLE `Vacancies` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Free` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Time_to_release` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Computer_id` int(11) NOT NULL,
  `Consoles_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_Vacancies_Computer1_idx` (`Computer_id`),
  KEY `fk_Vacancies_Consoles1_idx` (`Consoles_id`),
  CONSTRAINT `fk_Vacancies_Computer1` FOREIGN KEY (`Computer_id`) REFERENCES `Computer` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Vacancies_Consoles1` FOREIGN KEY (`Consoles_id`) REFERENCES `Consoles` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Visit
#

DROP TABLE IF EXISTS `Visit`;

CREATE TABLE `Visit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Date_and_time_of_rental` datetime NOT NULL,
  `Duration` time NOT NULL,
  `Price` int(11) NOT NULL,
  `Player_Information_id` int(11) NOT NULL,
  `Employees_id` int(11) NOT NULL,
  `Platform_id` int(11) NOT NULL,
  `Services_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk__Player_Information1_idx` (`Player_Information_id`),
  KEY `fk_Visit_Employees1_idx` (`Employees_id`),
  KEY `fk_Visit_Platform1_idx` (`Platform_id`),
  KEY `fk_Visit_Services1_idx` (`Services_id`),
  CONSTRAINT `fk_Visit_Employees1` FOREIGN KEY (`Employees_id`) REFERENCES `Employees` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Visit_Platform1` FOREIGN KEY (`Platform_id`) REFERENCES `Platform` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Visit_Services1` FOREIGN KEY (`Services_id`) REFERENCES `Services` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk__Player_Information1` FOREIGN KEY (`Player_Information_id`) REFERENCES `Player_Information` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



